\\|gimp\\|git\\|grep\\|head\\|ht\\|iftop\\|ionice\\|ip$\\|irb\\|jjs\\|jq\\|jrunscript\\|ksh\\|ld.so\\|ldconfig\\|less\\|logsave\\|lua\\|make\\|man\\|mawk\\|more\\|mv\\|mysql\\|nano\\|nawk\\|nc\\|netcat\\|nice\\|nl\\|nmap\\|node\\|od\\|openssl\\|perl\\|pg\\|php\\|pic\\|pico\\|python\\|readelf\\|rlwrap\\|rpm\\|rpmquery\\|rsync\\|ruby\\|run-parts\\|rvim\\|scp\\|script\\|sed\\|setarch\\|sftp\\|sh\\|shuf\\|socat\\|sort\\|sqlite3\\|ssh$\\|start-stop-daemon\\|stdbuf\\|strace\\|systemctl\\|tail\\|tar\\|taskset\\|tclsh\\|tee\\|telnet\\|tftp\\|time\\|timeout\\|ul\\|unexpand\\|uniq\\|unshare\\|vi\\|vim\\|watch\\|wget\\|wish\\|xargs\\|xxd\\|zip\\|zsh'","","system_info()","{","echo -e \"\\e[00;33m### SYSTEM ##############################################\\e[00m\" ","","#basic kernel info","unameinfo=`uname -a 2\u003e/dev/null`","if [ \"$unameinfo\" ]; then","  echo -e \"\\e[00;31m[-] Kernel information:\\e[00m\\n$unameinfo\" ","  echo -e \"\\n\" ","fi","","procver=`cat /proc/version 2\u003e/dev/null`","if [ \"$procver\" ]; then","  echo -e \"\\e[00;31m[-] Kernel information (continued):\\e[00m\\n$procver\" ","  echo -e \"\\n\" ","fi","","#search all *-release files for version info","release=`cat /etc/*-release 2\u003e/dev/null`","if [ \"$release\" ]; then","  echo -e \"\\e[00;31m[-] Specific release information:\\e[00m\\n$release\" ","  echo -e \"\\n\" ","fi","","#target hostname info","hostnamed=`hostname 2\u003e/dev/null`","if [ \"$hostnamed\" ]; then","  echo -e \"\\e[00;31m[-] Hostname:\\e[00m\\n$hostnamed\" ","  echo -e \"\\n\" ","fi","}","","user_info()","{","echo -e \"\\e[00;33m### USER/GROUP ##########################################\\e[00m\" ","","#current user details","currusr=`id 2\u003e/dev/null`","if [ \"$currusr\" ]; then","  echo -e \"\\e[00;31m[-] Current user/group info:\\e[00m\\n$currusr\" ","  echo -e \"\\n\"","fi","","#last logged on user information","lastlogedonusrs=`lastlog 2\u003e/dev/null |grep -v \"Never\" 2\u003e/dev/null`","if [ \"$lastlogedonusrs\" 